import React from "react";
import { Link } from "react-router-dom";

const NotFound = () => {
  return (
    <div>
      <h1>페이지를 찾을 수 없습니다.</h1>
      <p>메인 페이지로 돌아가려면 아래 링크를 클릭하세요.</p>
      <Link to="/">메인 페이지로 이동</Link>
    </div>
  );
};

export default NotFound;
